signed main() {
    int n, k;
    std::cin >> n >> k;
    std::vector<int> v(n);
    read(v);
    std::vector<int> count (k, 0);
    for (int i = 0; i < n; ++i){
        count[v[i] % k]++;
    }
    int cnt = count[0]/2;
    if (k % 2 == 0) cnt += count[k/2]/2;
    count[k/2] = 0;
    for (int i = 1; i < (k + 1)/2; ++i){
        cnt += std::min(count[k - i], count[i]);
        count[i] = 0;
        count[k - i] = 0;
    }
    std::cout << cnt * 2;
}

