----/ TrainSignalSystem class /---------------------------------------------


local instances = {}


--/ constructors /--


function new(id1, id2)
    local self = {}
    self.subSystem1 = {
        id = id1,
        signalState = false,
    }
    self.subSystem2 = {
        id = id2,
        signalState = false,
    }
    return self
end


--/ functions /--


function findFromComputerId(id)
    for _, tss in pairs(instances) do
        if tss.subSystem1.id == id then
            return tss, tss.subSystem1, tss.subSystem2 -- the entire system, the relevant sub-system, and the other sub-system
        elseif tss.subSystem2.id == id then
            return tss, tss.subSystem2, tss.subSystem1 -- the entire system, the relevant sub-system, and the other sub-system
        end
    end
end


----/ linked computer ids /---------------------------------------------


--[[   
    Each array represents a train signal network, and the numbers are computer ids
]]

local linkedIds = {
    -- {120, 114},
    {3, 5}
}


----/ make systems from linked ids /---------------------------------------------


for _, list in pairs(linkedIds) do
    local trainSignalSystem = new(unpack(list))
    table.insert(instances, trainSignalSystem)
end

